import React from 'react';

import Slider from "react-slick";

class VariableWidth extends React.Component {
    render() {
      const settings = {
        className: 'slider variable-width',
        slidesToShow: 1,
        slidesToScroll: 1,
        variableWidth: true,
        infinite: false,
        arrows: true
      };
      return (
        <div className="container">
          <h2>Variable width</h2>
          <Slider {...settings}>
            <div className="dadada" style={{width: 100}}><p>100</p></div>
            <div className="dadada" style={{width: 200}}><p>200</p></div>
            <div className="dadada" style={{width: 75}}><p>75</p></div>
            <div className="dadada" style={{width: 300}}><p>300</p></div>
            <div className="dadada" style={{width: 225}}><p>225</p></div>
            <div className="dadada" style={{width: 175}}><p>175</p></div>
          </Slider>
        </div>
      );
    }
  }
  
  ReactDOM.render(
    <VariableWidth />,
    document.getElementById('container')
  );


const Home = () => {
    return(
        <div className="app">
            <h1>Home Page</h1>
        </div>
    )
}
export default Home;
